/**
 * Type of brokerage. Currently supports traditional brokerages and crypto exchanges.
 * @export
 * @interface BrokerageType
 */
export interface BrokerageType {
    [key: string]: any;
    /**
     *
     * @type {string}
     * @memberof BrokerageType
     */
    'id'?: string;
    /**
     *
     * @type {string}
     * @memberof BrokerageType
     */
    'name'?: string;
}
